- input: "TEXT\x1CC00000885\x1C32502659\x1C\x1CF3XA\x1CThis amendment is filed in
    response to the Commission's letter dated October 6, 2010.  Changes made to disbursements
    prior to the reporting period of the September Monthly report caused the inconsistency
    between report Lines 23 and 29, Column B of the Detailed Summary Page as noted.
    This inconsistency has been corrected.    Secondly, we performed a thorough review
    of our disbursements to the Garamendi for Congress Committee and found no evidence
    of excessive contributions.  However, the October 9, 2009 disbursement noted in
    the Commission's letter was erroneously reported as a General election contribution.
    In actuality this contribution was designated to the 2009 Special Runoff election.
    We will correct our November 2009 Monthly report to further clarify this designation.
    \  Finally, the Manchin for West Virginia contribution was properly designated
    in writing to the 2010 Special Primary election, although the electronic report
    indicated Primary 2010. This report has also been modified to better communicate
    this designation within the electronic data as well as within the report description
    of the contribution.\n"
